window.bookSummaryJSON = "<p>The epic series from #1 bestselling global phenomenon author Sarah J. Maas continues with a stunning story of love, war, and revenge.<br> <br> Feyre has returned to the Spring Court, determined to gather information on Tamlin’s actions and learn what she can about the invading king threatening to bring her land to its knees. But to do so she must play a deadly game of deceit. <br> <br> One slip could bring doom not only for Feyre but for everything—and everyone she holds dear. <br> <br> As war bears down upon them all, Feyre endeavors to take her place as one of the High Fae of the land, balancing her struggle to master her powers—both magical and political—and her love for her court and family. Amidst these struggles, Feyre and Rhysand must <br> decide whom to trust among the cunning and lethal High Lords, and hunt for allies in unexpected places.<br> <br> In this thrilling third book in the Court of Thorns and Roses series, the fate of Feyre’s world is at stake as armies grapple for power over the one thing that could destroy it.</p>"; 
